import React from 'react';
import TopHeaderBar from '../component/TopHeaderBar/TopHeaderBar';
import EnhancedHeroSection from '../component/EnhancedHeroSection/EnhancedHeroSection';
import Services from '../component/Services/Services';
import Testimonials from '../component/Testimonials/Testimonials';
import Achievements from '../component/Achievements/Achievements';
import Experience from '../component/Experience/Experience';
import Gallery from '../component/Gallery/Gallery';
// Mock components for new sections - you would create these as new files.

const WhyChooseUs = () => (
  <section className="why-choose-us-section">
    {/* Content for Why Choose Us would go here */}
    <h2>Why Choose ANF Academy?</h2>
    <p>Details about unique selling points.</p>
  </section>
);

const CallToAction = () => (
  <section className="cta-section">
    {/* Content for Call To Action would go here */}
    <h2>Ready to Unlock Your Child's Potential?</h2>
    <button className="cta-btn primary">Enroll Now</button>
  </section>
);

const Footer = () => (
  <footer className="professional-footer">
    {/* Footer content would go here */}
    <p>&copy; {new Date().getFullYear()} ANF Academy. All Rights Reserved.</p>
  </footer>
);

import './ProfessionalHome.css';

const ProfessionalHome = () => {
  return (
    <div className="professional-home">
      <TopHeaderBar />
      <main>
        <EnhancedHeroSection />
        <WhyChooseUs />
        <Services />
        <CallToAction />
        <Testimonials />
        <Achievements />
        <Experience />
        <Gallery />
      </main>
      <Footer />
    </div>
  );
};

export default ProfessionalHome;
